(17, 'The beginning of the project', '<p>For this project, I was with Alexandre, Thomas, Alban and Giovani. I took the role of the client and the others the role of the web agency. Then, we began to look for ideas concerning the nature of the project. We chose theme of the music, and from it I decided to be guiding of a recent sound recording label. As customer, I gave my problem to the team as well as my desires concerning the project :</p>\r\n\r\n<p>&laquo; I recently created a record company named RedRecord. I thus have few artist to my credit for the moment and I want to create the web site of my label. I would like with this site to promote my company as well as my artists in a original way. I have a limited budget but being an important point of my record company this site has to be worth it and I shall put in it the price. More exactly, I need a logo, and a graphics standard, rather simple and in red tones.&raquo;</p>\r\n\r\n<p>To finish, we began to speak about the project and to note the ideas of each, we ended with a brainstorming.</p>\r\n', '2013-06-27 18:40:45', '2013-06-27 18:41:02'),
(18, 'The progress and the end of the project', '<p>The following week, &nbsp;the team of the web agency present to me a first sketch of the project, a logo, a graphics standard and a web site. I was surprised by the supplied work, and this one pleased me enormously. Then, I expressed them my opinion and some tracks to finalize all this.<br />\r\nThey then showed me a version finished by the site, I then omitted some critic, and the week according to the project was ended.</p>\r\n\r\n<p>&quot;I was very satisfied to work with this team, it was simple, clear and fast. I could contact again them for a future project. The site which they realized is a success, I have from now on new proposals to promote artists and I was made a more ample place in this environment. &quot;</p>\r\n', '2013-06-27 18:41:17', '2013-06-27 18:41:54');
